import React, { Component } from 'react';
import './ProductManagement.style.scss';
import { Row, Col, Input, List } from 'antd';
import { SearchOutlined } from '@ant-design/icons';

const data = [
  'Racing car sprays burning fuel into crowd.',
  'Japanese princess to wed commoner.',
  'Australian walks 100km after outback crash.',
  'Man charged over missing wedding girl.',
  'Los Angeles battles huge wildfires.',
];

export default class ProductManagement extends Component {
  render() {
    return (
      <div className="product-management animated fadeIn">

        <div className="product-management__container">
          <Row>
            <Col span={4}>
              <div className="product-management__container__left-sidebar">
                <h3 className="product-management__container__left-sidebar__title">
                  Danh mục sản phẩm
                </h3>
                <div className="product-management__container__left-sidebar__search-box">
                  <Input
                    prefix={<SearchOutlined style={{ marginRight: 5 }} />}
                    placeholder="Search category..." />
                </div>
                <div className="product-management__container__left-sidebar__categories">
                  <div className="product-management__container__left-sidebar__categories__wrapper">
                    <List
                      size="small"
                      dataSource={data}
                      renderItem={item => (
                        <List.Item className=".product-management__container__left-sidebar__categories__item">
                          {item}
                        </List.Item>
                      )}
                    />
                  </div>
                </div>
              </div>
            </Col>
            <Col span={20}>
              <div className="product-management__container__topbar"></div>
              <div className="product-management__container__content"></div>
            </Col>
          </Row>
        </div>

      </div>
    )
  }
}
